import Layout from '../components/MyLayout';
import Header from '../components/Header';
import Link from 'next/link';

export default function Blog() {
  return (
    <Layout>
      <div className="container">
        <div className="info">

        </div>
      </div>
      <style jsx>{`
        .container {
          height: 100vh;
          background: gray;
        }

        h1,
        a {
          font-family: 'Arial';
        }
      `}</style>
    </Layout>
  );
}
